@media only screen

    }
}

    }
    .content_center{

    }
    .content_right{
        width: 100%;
        float: right;
    }

#nav{
    list-style:none;
    font-weight:bold;
    /*margin-bottom:10px;*/
    width:100%;
    position:relative;
    z-index:5;
    /*    width: 200px;*/
    margin-left: -40px;
    margin-top: 0px;
    margin-bottom: 0px;
}
#nav li{
    float:left;
    /*    margin-right:10px;*/
    position:relative;
}
#nav a{
    display:block;
    /*    padding:5px;*/
    color:#fff;
    background:#333;
    text-decoration:none;
}
#nav a:hover{
    color:#fff;
    background:#6b0c36;
    text-decoration:underline;
}

/*--- DROPDOWN ---*/
#nav ul{
    background:#fff; /* Adding a background makes the dropdown work properly in IE7+. Make this as close to your page's background as possible (i.e. white page == white background). */
    background:rgba(255,255,255,0); /* But! Let's make the background fully transparent where we can, we don't actually want to see it if we can help it... */
    list-style:none;
    position:absolute;
    left:-9999px; /* Hide off-screen when not needed (this is more accessible than display:none;) */
    padding-left: 0px;
}
#nav ul li{
    padding-top:1px; /* Introducing a padding between the li and the a give the illusion spaced items */
    float:none;
}
#nav ul a{
    white-space:nowrap; /* Stop text wrapping and creating multi-line dropdown items */
}
#nav li:hover ul{ /* Display the dropdown on hover */
    left:0; /* Bring back on-screen when needed */
}
#nav li:hover a{ /* These create persistent hover states, meaning the top-most link stays 'hovered' even when your cursor has moved down the list. */
    background:#6b0c36;
    text-decoration:underline;
}
#nav li:hover ul a{ /* The persistent hover state does however create a global style for links even before they're hovered. Here we undo these effects. */
    text-decoration:none;
}
#nav li:hover ul li a:hover{ /* Here we define the most explicit hover states--what happens when you hover each individual link. */
    background:#333;
}

                isChangeNumberOfPiece = moveOneCrossLeftFoward(fCell);
            }
            if (fCellRow === tCellRow - 2) {
                isChangeNumberOfPiece = moveAsKnight(fCell);
            }
        } else if (fCellColumn > tCellColumn + 1) {
            if (fCellRow > tCellRow + 1) {
                isChangeNumberOfPiece = moveMoreCrossRightBackward(fCell);
            }
            if (fCellRow < tCellRow - 1) {
                isChangeNumberOfPiece = moveMoreCrossRightFoward(fCell);
            }
        } else if (fCellColumn < tCellColumn - 1) {
            if (fCellRow > tCellRow + 1) {
                isChangeNumberOfPiece = moveMoreCrossLeftBackward(fCell);
            }
            if (fCellRow < tCellRow - 1) {
                isChangeNumberOfPiece = moveMoreCrossLeftFoward(fCell);
            }
        }
        if (isChangeNumberOfPiece) {
            var originalPlayer = getOriginalPlayer(fCell);
            if (parseInt(originalPlayer) === 1) {
                updateGameStatusWhenChangeNumberOfPiecePlayer1();
            } else if (parseInt(originalPlayer) === 2) {
                updateGameStatusWhenChangeNumberOfPiecePlayer2();
            }
        }
    };

        var jusContainPiece = true;
        for (var i = 0; i < pSet.length; i++) {
            var isContainedInPieceArray = false;
            for (var j = 0; j < pieceArray.length; j++) {
                if (pSet[i] === pieceArray[j]) {

                break;
            }
        }

    clickOnCell = function(cell, replayChoosePromoted) {

        var isStartMove = document.getElementById('isStartMove').value;
        //showDebugInfo(cell);
        if (isEndGame()) {
            return;
        }
        var currentMovePlayer = parseInt(document.getElementById('currentMovePlayer').value);
        if (isStartMove === '0' && isMyPiece(cell, parseInt(currentMovePlayer))) {
            clickCellToMove(cell, parseInt(currentMovePlayer));
        } else if (isStartMove === '1') {
            if (isMyPiece(cell, currentMovePlayer)) {
                updateNormalColor();
                clickCellToMove(cell, currentMovePlayer);
            } else {
                if (validateMove(fromCell, cell)) {
                    var canPromote = getCanPromote(fromCell, cell, currentMovePlayer);
                    var choosePromote = false;
                    //canPromote = false;
                    var mustPromote = getMustPromote(fromCell, cell, currentMovePlayer);
                    if (replayChoosePromoted !== undefined) {
                        choosePromote = replayChoosePromoted;
                    } else {
                        if (canPromote) {
                            if (!mustPromote) {
                                if (canMoveWhenChooseNotPromoted(fromCell, cell, currentMovePlayer)) {
                                    choosePromote = confirm("Do you want to promote this piece?");
                                } else {
                                    alert("Auto promoted");
                                    choosePromote = true;
                                }
                            } else {
                                alert("Auto promoted");
                                choosePromote = true;
                            }
                        }
                    }

                    if (canPromote) {
                        if (choosePromote) {
                            saveGameStatus();
                            removeRedoGameStatus();
                            //setIsStartMove('0');
                            toCell = cell;
                            if (isContainPieces(toCell)) {
                                capturePieceWhenMove(toCell, currentMovePlayer);
                            }
                            updateGameStatus(fromCell, toCell, currentMovePlayer);
                            updateCurrentPiecePositionWhenMove(fromCell, toCell);
                            updateNormalColor();
                            removeCannotPromotePieceIfChoosePromote(fromCell, toCell);
                            promotePiece(fromCell, toCell);
                            checkTotalPossiblityPiece();
                            checkTotalClearPiece();
                            updateDisplayPieceWhenMove();
                            updateCurrentMovePlayer(currentMovePlayer);

                            //saveLogGame(fromCell, toCell, currentMovePlayer, choosePromote);
                            playMoveSound();
                        } else {
                            if (!mustPromote) {
                                //if (canMoveWhenChooseNotPromoted(fromCell, cell, currentMovePlayer)) {
                                saveGameStatus();
                                removeRedoGameStatus();
                                setIsStartMove('0');
                                toCell = cell;
                                if (isContainPieces(toCell)) {
                                    capturePieceWhenMove(toCell, currentMovePlayer);
                                }
                                updateGameStatus(fromCell, toCell, currentMovePlayer);
                                removeMustPromotePieceIfChooseDonotPromote(fromCell, toCell, currentMovePlayer);
                                updateCurrentPiecePositionWhenMove(fromCell, toCell);
                                updateNormalColor();
                                checkTotalPossiblityPiece();
                                checkTotalClearPiece();
                                updateDisplayPieceWhenMove();
                                updateCurrentMovePlayer(currentMovePlayer);
                                //saveLogGame(fromCell, toCell, currentMovePlayer, false);
                                playMoveSound();
                                //                                } else {
                                //                                    alert("You have to promoted");
                                //                                }
                            } else {
                            }
                        }
                    } else {
                        saveGameStatus();
                        removeRedoGameStatus();
                        setIsStartMove('0');
                        toCell = cell;
                        if (fromCell.id.indexOf('capturePlayer') !== -1) {
                            removeCannotDropPiece(fromCell, toCell, currentMovePlayer);
                        } else {
                            if (isContainPieces(toCell)) {
                                capturePieceWhenMove(toCell, currentMovePlayer);
                            }
                            updateGameStatus(fromCell, toCell, currentMovePlayer);
                            updateCurrentPiecePositionWhenMove(fromCell, toCell);
                        }
                        updateNormalColor();
                        checkTotalPossiblityPiece();
                        checkTotalClearPiece();
                        updateDisplayPieceWhenMove();
                        updateCurrentMovePlayer(currentMovePlayer);
                        //saveLogGame(fromCell, toCell, currentMovePlayer, false);
                        playMoveSound();
                    }
                }
            }
        }
    };

    checkEndGame = function() {
        var haveAKing = 0;
        for (var i = 0; i < piecePlayer1.length; i++) {
            var aQuantumPiece = piecePlayer1[i];
            if (justContainKing(aQuantumPiece.pSet)) {
                if (piecePlayer1[i].currentPlayer === 2) {
                    haveAKing = 1;
                }
                break;
            }
        }
        for (var i = 0; i < piecePlayer2.length; i++) {
            var aQuantumPiece = piecePlayer2[i];
            if (justContainKing(aQuantumPiece.pSet)) {
                if (piecePlayer2[i].currentPlayer === 1) {
                    haveAKing = 2;
                }
                break;
            }
        }
        return haveAKing;
    };

    getPieceFromId = function(pieceNumber) {
        var strPiece = '';
        switch (pieceNumber) {
            case 1:
                strPiece = 'king';
                break;
            case 2:
                strPiece = 'rook';
                break;
            case 3:
                strPiece = 'bishop';
                break;
            case 4:
                strPiece = 'g_general';
                break;
            case 5:
                strPiece = 's_general';
                break;
            case 6:
                strPiece = 'knight';
                break;
            case 7:
                strPiece = 'pawn';
                break;
            case 8:
                strPiece = 'lance';
                break;
        }
        return strPiece;
    };
    getPositionTypeFromId = function(positionId, player) {
        var strPositionType = '';
        switch (positionId) {
            case 1:
                strPositionType = 'chessCell';
                break;
            case 2:
                if (player === 1) {
                    strPositionType = 'capturePlayer2';
                } else if (player === 2) {
                    strPositionType = 'capturePlayer1';
                }
                break;
        }
        return strPositionType;
    };

    updateCurrentPiecePositionWhenMove = function(fCell, tCell) {
        var tcellId = tCell.id;
        var arrTCellId = tcellId.split('_');
        var originalPlayer = getOriginalPlayer(fCell);
        if (parseInt(originalPlayer) === 1) {
            var orderNum = getQuantumPieceNumberByCell(fCell);
            piecePlayer1[orderNum].setCurrentRowPosition(parseInt(arrTCellId[1]));
            piecePlayer1[orderNum].setCurrentColumnPosition(parseInt(arrTCellId[2]));
        } else if (parseInt(originalPlayer) === 2) {
            var orderNum = getQuantumPieceNumberByCellPlayer2(fCell);
            piecePlayer2[orderNum].setCurrentRowPosition(parseInt(arrTCellId[1]));
            piecePlayer2[orderNum].setCurrentColumnPosition(parseInt(arrTCellId[2]));
        }
        return null;
    };

    allowMove = function(fCell, tCell) {
        if (fCell.id.indexOf('chessCell') !== -1 && tCell.id.indexOf('capturePlayer') !== -1) {
            return false;
        }
        if (fCell.id.indexOf('capturePlayer') !== -1 && tCell.id.indexOf('capturePlayer') !== -1) {
            return false;
        }

    union_arrays = function(x, y) {
        var obj = {};
        for (var i = x.length - 1; i >= 0; -- i)
            obj[x[i]] = x[i];
        for (var i = y.length - 1; i >= 0; -- i)
            obj[y[i]] = y[i];
        var res = [];
        for (var k in obj) {
            if (obj.hasOwnProperty(k))  // <-- optional
                res.push(obj[k]);
        }
        return res;
    };

            if (b.indexOf(e) !== -1)
                return true;
        });

        var gameId = generateGameId();
        location.href = 'shogiAction!startNewGame.action?gameId=' + gameId;
    };
